import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 200vh;
  width: 100vw;

  .sticky-trigger-1 {
    margin-top: 50vh;
  }
`;

function SlideTwo() {
  return (
      <StyledSlideTwo>
          <div className='sticky-trigger-1' />
          <CarInfoDisplay />
      </StyledSlideTwo>
  );
}

export default SlideTwo;
